import React, { Component, useEffect, useState } from "react"

export default class Subscription extends Component{

  constructor(props){
    super(props);
    this.state ={
      error:null,
      isLoaded:false,
      products:[]
    };
  }

  componentDidMount(){
    fetch("https://localhost:7028/api/Product")
    .then(res => res.json())
    .then(
      (result) =>{
        this.setState({
          isLoaded:true,
          products:result.product
        });
      },
      (error) =>{
        this.setState({
          isLoaded:true,
          error
        });
      }
    )
  }

  render(){
    const {error,isLoaded, products} = this.state;

    if (error){
      return <p> Error {error.message}</p>
    } else if(!isLoaded){
      return <p> Loading...</p>
    } else {
      return(
        <Ul>
          {products.map(product =>(
            <li key={product.nameProd}>
              {product.name}
            </li>
          ))}
        </Ul>
      )
    }
  }

}
